const App = () => {
  const [query, setQuery] = useState("");

  return (
    <div className="main">
      <h1>React Search</h1>
      <div className="search">
        <TextField
          id="outlined-basic"
          variant="outlined"
          fullWidth
          label="Search"
        />
      </div>

      <List />

    </div>
  )

}

export default App;
